typedef struct {
    pthread_mutex_t lock;
    long total_requests;
} thread_pool_t;

c
// Atomic increment pattern
pthread_mutex_lock(&pool->lock);
pool->total_requests++; 
pthread_mutex_unlock(&pool->lock);

